import React from 'react';


function Card ({name,diets,image}){
    return(
        <div>
            <h3>{name}</h3>
            <h5>{diets + " "}</h5>
            <img src={image} alt="not found" width='200px' height='250px'/>
            <hr />
        </div>
    )
};


export default Card
